{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/andralisman/case-study-in-r-bellabeat?scriptVersionId=90576283\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"dda89e8e","metadata":{"_cell_guid":"29843a21-12f8-4113-9c36-a70a59519019","_uuid":"d48fb8a7-0426-4c9e-899d-d6df26a4294a","papermill":{"duration":0.214755,"end_time":"2022-03-19T14:56:52.421027","exception":false,"start_time":"2022-03-19T14:56:52.206272","status":"completed"},"tags":[]},"source":["# **How Can a Wellness Technology Company Play It Smart?**\n","## **Case Study in R. Bellabeat**\n","#### By Andra Lisman"]},{"cell_type":"markdown","id":"9f1ded6b","metadata":{"_cell_guid":"5eed1c26-840b-441e-b60c-4675217e86d1","_uuid":"18b83d8d-f22d-44c3-a41d-2fd01b815804","papermill":{"duration":0.213128,"end_time":"2022-03-19T14:56:52.84662","exception":false,"start_time":"2022-03-19T14:56:52.633492","status":"completed"},"tags":[]},"source":["### **Table of Contents**\n","\n","#### 1. Introduction\n","#### 2. Ask Phase\n","#### 3. Prepare Phase\n","#### 4. Process Phase\n","    4.1. Analysis tool and tool preparation\n","    4.2. Uploading the dataframes\n","    4.3. Dataframes review and data cleaning\n","    4.4. Merging dataframes\n","#### 5. Analyze and Share Phases\n","    5.1. Summarising values\n","    5.2. Activity level\n","    5.3. Sleep levels\n","    5.4. Use of the Bellabeat device\n","    5.5. Correlations\n","#### 6. Act Phase"]},{"attachments":{"4ca80001-b6b2-4e0e-8f2c-a114839bc29e.jpg":{"image/jpeg":""}},"cell_type":"markdown","id":"b05306d1","metadata":{"_cell_guid":"1b36e041-7b5b-46c5-b74f-b4b8a0e2d622","_uuid":"7742217c-1d83-4c71-bbd4-bcf645e18f3c","papermill":{"duration":0.21077,"end_time":"2022-03-19T14:56:53.273005","exception":false,"start_time":"2022-03-19T14:56:53.062235","status":"completed"},"tags":[]},"source":["### **1. Introduction**\n","\n","**Bellabeat** is a high-tech company that manufactures health-focused smart devices for women, founded in 2013 by Urka Sren and Sando Mur. Their products collect data on nutrition, activity, sleep and stress empowering women with knowledge which help them better understand their habits and make healthier decisions.\n","\n","Here is a list of their current products:\n","* Bellabeat app: provides users with health data related to their activity, sleep, stress, menstrual cycle and mindfulness habits. \n","* Leaf: a wellness tracker that can be worn as a bracelet,necklace or clip, connected to the Bellabeat app to track activity, sleep and stress.\n","* Time: a wellness watcg that tracks activity,sleep and stress, connected to the Bellabeat app to get insights into the user's wellness.\n","* Spring: a water bottle that tracks daily water intake, connected to the Bellabeat app to track hydration levels.\n","* Bellabeat membership: a subscription-bases membership program for users, with 24/7 access to fully personalized guidance on nutrition, activity, sleep, health, beauty and mindfulness based on lifestyle and goals.\n","\n","![Bellabeat products 2.jpg](attachment:4ca80001-b6b2-4e0e-8f2c-a114839bc29e.jpg)"]},{"cell_type":"markdown","id":"fad27a9a","metadata":{"_cell_guid":"1f4286af-c04a-4bde-af7f-418ece4aa95e","_uuid":"c980d28c-a8c2-47b3-84d9-c4728787e23b","papermill":{"duration":0.213265,"end_time":"2022-03-19T14:56:53.696357","exception":false,"start_time":"2022-03-19T14:56:53.483092","status":"completed"},"tags":[]},"source":["### **2. Ask Phase**\n","\n","#### **Business task**\n","\n","This case study focuses on analyzing smart device usage data to gain insight into how consumers are using the Bellabeat device, which will help unlock new growth opportunities.\n","\n","#### **Stakeholders**\n","\n","* Urka Sren - Bellabeats co-founder and Chief Creative Officer\n","* Sando Mur - Bellabeats co-founder and key member of Bellabeat executive team"]},{"cell_type":"markdown","id":"375ae743","metadata":{"_cell_guid":"90f6882d-9477-4a66-8c96-b747afc61df7","_uuid":"325ed926-f997-49a5-8fe3-8db767faa258","papermill":{"duration":0.211115,"end_time":"2022-03-19T14:56:54.119727","exception":false,"start_time":"2022-03-19T14:56:53.908612","status":"completed"},"tags":[]},"source":["### **3. Prepare Phase**\n","\n","#### **Dataset**\n","\n","The data source used for this analysis is [FitBit Fitness Tracker Data](http://www.kaggle.com/arashnic/fitbit), which is a public dataset made available through [Mobius](https://www.kaggle.com/arashnic). \n","\n","#### **Data privacy and accessibility**\n","\n","When verifying the [Metadata](https://www.kaggle.com/arashnic/fitbit/metadata) we can confirm that the dataset is an [open source](https://zenodo.org/record/53894#.X9oeh3Uzaao). The dataset has been generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016 and 05.12.2016. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring.\n","\n","#### **Data organization**\n","\n","The data comes in 18 .csv files with several rows for each subject (ID). Part of the files have a long format, and others have a wide format.\n","\n","#### **Data limitations**\n","\n","The data is original, comprehensive and cited.\n","However, it includes a small sample, a small period of data collection (31 days) and it doesnt show any demographic information, which translates in highly possibly biased data. Another limitation is that the data is not current (2016)."]},{"cell_type":"markdown","id":"3e0598d7","metadata":{"_cell_guid":"6b099889-f645-46ca-a4a0-b9d7c6dbbac8","_uuid":"59dc90a7-c83a-4874-9f7a-a3fc8c21c940","papermill":{"duration":0.210785,"end_time":"2022-03-19T14:56:54.540215","exception":false,"start_time":"2022-03-19T14:56:54.32943","status":"completed"},"tags":[]},"source":["### **4. Process Phase**\n","\n","#### **4.1. Analysis tool and tool preparation**\n","\n","The analysis has been performed in R, which provides an accessible language to organize, modify and clean dataframes, and create insightful data visualizations for this analysis."]},{"cell_type":"code","execution_count":1,"id":"4b9de646","metadata":{"_cell_guid":"e632060f-54f5-46ef-9e92-ba31b169daf7","_kg_hide-input":false,"_kg_hide-output":true,"_uuid":"0039480d-7dbf-4f49-bd7d-f049caa06907","collapsed":false,"execution":{"iopub.execute_input":"2022-03-19T14:56:54.975277Z","iopub.status.busy":"2022-03-19T14:56:54.97191Z","iopub.status.idle":"2022-03-19T15:01:31.647142Z","shell.execute_reply":"2022-03-19T15:01:31.645266Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":276.895781,"end_time":"2022-03-19T15:01:31.647386","exception":false,"start_time":"2022-03-19T14:56:54.751605","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into /usr/local/lib/R/site-library\n","(as lib is unspecified)\n","\n","also installing the dependency vroom\n","\n","\n","Installing package into /usr/local/lib/R/site-library\n","(as lib is unspecified)\n","\n","Installing package into /usr/local/lib/R/site-library\n","(as lib is unspecified)\n","\n","Installing package into /usr/local/lib/R/site-library\n","(as lib is unspecified)\n","\n","Installing package into /usr/local/lib/R/site-library\n","(as lib is unspecified)\n","\n","also installing the dependency rlang\n","\n","\n","Warning message in install.packages(\"dplyr\"):\n","installation of package rlang had non-zero exit status\n","Warning message in install.packages(\"dplyr\"):\n","installation of package dplyr had non-zero exit status\n","Installing package into /usr/local/lib/R/site-library\n","(as lib is unspecified)\n","\n"]}],"source":["# Installing the packages that we will use\n","\n","install.packages(\"readr\")\n","install.packages(\"t